(1, 43, 'Aventura Roofing', 'aventura-roofing', '<h1 style=\"text-align: center;\">Aventura Residential &amp; Commercial Roofing Services</h1>\r\n<div>\r\n<div>\r\n<div>\r\n<h1 style=\"text-align: center;\"><strong><img src=\"images/Skyline-Roofs-Contractors-roofer4.png\" alt=\"Skyline Roofs Contractors\" style=\"float: right;\" /></strong></h1>\r\n<strong><span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span></strong><span style=\"font-size: 12pt;\"> is a Miami based roofing company that has been providing South Florida homeowners and businesses with the professional Residential &amp; Commercial roofing solutions since 2008. We not only strive to make each homeowner a customer, but to also make each customer a friend. Referrals are a majority of our business and we want your experience with Skyline Roofs Contractors to be the finest you will ever encounter with a roofing company.</span>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-size: 12pt;\">Our reputation is a reflection of our commitment to providing our customers with the highest level of workmanship and customer service available in South Florida, and surrounding areas. We are committed to providing you the following:</span><span style=\"font-size: 12pt;\"></span></div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">High Quality Residential &amp; Commercial Roofing Solutions</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Fully Insured with written guarantees and references</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Free Inspection and Free Estimates, No Obligation</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Excellent Workmanship by Factory Certified Installers</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Sweep Work Area With Magnetic Nail Bar</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Approved by all Major Insurance Companies</span></li>\r\n</ul>\r\n</div>\r\n<br />\r\n<p>&nbsp;</p>\r\n<p>{loadposition fp-content}</p>\r\n<hr />\r\n<p><span style=\"font-size: 12pt;\">As a South Florida roofing company, <span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span></span> works extensively through Miami-Dade, Broward, Palm Beach and Monroe Counties. When sufficient damage exists, we will deal with insurance companies and insurance adjusters to insure that you get the fairest settlement amount that you are entitled to as a homeowner. We screen and handpick all of our roofing crews in order to ensure the highest quality craftsmanship and service. </span></p>\r\n<div><span style=\"font-size: 12pt;\">Our goal is not only to fix or replace your roof, but also to deliver a long lasting and dependable roofing solution in a manner that is efficient, cost-effective, and convenient. The professionals at <span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span></span> will inspect your roof for free and walk you through claims and construction process.</span></div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 17, '2014-03-12 15:45:40', 981, '', '2017-03-29 20:34:58', 981, 0, '0000-00-00 00:00:00', '2014-03-12 15:45:40', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 31, 6, '', '', 1, 1375, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(2, 44, 'Module Positions', 'module-positions', '<p>The Layouts panel in the Lexicon template administration interface provides several options for configuring the layout of the template. Each modular section of the template design offers six module positions by default.</p>\r\n\r\n<p class=\"success\">Note: If no modules are published to a position, the entire area or row will not appear or collapse.</p>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Header</h4></th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    <tr>\r\n      <td>A</td>\r\n      <td>B</td>\r\n      <td>C</td>\r\n      <td>D</td>\r\n      <td>E</td>\r\n      <td>F</td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Drawer</h4></th>\r\n    </tr>\r\n  </thead>\r\n</table>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Top</h4></th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    <tr>\r\n      <td>A</td>\r\n      <td>B</td>\r\n      <td>C</td>\r\n      <td>D</td>\r\n      <td>E</td>\r\n      <td>F</td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Slideshow</h4></th>\r\n    </tr>\r\n  </thead>\r\n</table>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Showcase</h4></th>\r\n    </tr>\r\n  </thead>\r\n  <tbody>\r\n    <tr>\r\n      <td>A</td>\r\n      <td>B</td>\r\n      <td>C</td>\r\n      <td>D</td>\r\n      <td>E</td>\r\n      <td>F</td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n\r\n<table class=\"table table-bordered gantry-center\">\r\n  <thead>\r\n    <tr>\r\n      <th colspan=\"6\"><h4>Breadcrumb</h4></th>\r\n    </tr>\r\n  </thead>\r\n</table>\r\n\r\n<table class=\"table table-bor