(5, 47, 'Menu Options', 'menu-options', '<p class=\"success\">RokNavMenu is the core of all the powerful Acacia menu system. Please ensure you are using the latest version of RokNavMenu, available <a href=\"http://www.rockettheme.com/extensions-joomla/roknavmenu\" target=\"_blank\">here</a>.</p>\r\n\r\n<h2>Dropdown Menu</h2>\r\n\r\n<p>The <strong>Dropdown Menu</strong> is an advanced CSS drive dropdown menu system. It offers advanced structural features such as multiple columns, inline icons and text, inline modules and positions, custom column widths, item distribution and menu offset. All of these are configurable for each menu item.</p>\r\n\r\n<span class=\"rt-image\"><img src=\"images/rocketlauncher/features/menu-options/dropdownmenu.jpg\" alt=\"Dropdown Menu\" /></span>\r\n\r\n<div class=\"clear largemarginbottom\">&nbsp;</div><br />\r\n\r\n<h2>SplitMenu</h2>\r\n\r\n<p>A static menu system that displays 1st level items in the main horizontal menu and further children in the Sidebar.</p>\r\n\r\n<span class=\"rt-image\"><img src=\"images/rocketlauncher/features/menu-options/splitmenu.jpg\" alt=\"SplitMenu\" /></span>\r\n\r\n<div class=\"clear largemarginbottom\">&nbsp;</div><br />\r\n\r\n<div class=\"gantry-width-block gantry-width-30\">\r\n	<p class=\"rt-image largemarginright\">\r\n	<img class=\"rt-noborder\" src=\"images/rocketlauncher/features/menu-options/responsive-nav.png\" alt=\"image\"  />\r\n	</p>\r\n</div>\r\n\r\n<h2>Responsive Mode: Smartphone</h2>\r\n\r\n<p>For mobile devices, there are two options, a dropdown panel menu with items in a tree format or a select box using the browsers own UI elements. Chose a format in the template\'s menu settings.</p>\r\n\r\n<p>The mobile menu is active for both the Dropdown Menu and SplitMenu.</p>\r\n\r\n<div class=\"clear\"></div>', '', 0, 11, '2014-03-12 15:46:23', 981, '', '2014-03-17 14:11:15', 627, 0, '0000-00-00 00:00:00', '2014-03-12 15:46:23', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\