(7, 49, 'About Us', 'about-us', '<div class=\"gantry-row\">\r\n<div class=\"gantry-width-33\">\r\n<div class=\"gantry-width-spacer\"><span class=\"rt-image\"><img src=\"images/Skyline-Roofs-Contractors-about-us-1.jpg\" alt=\"Skyline Roofs Contractors \" /></span>\r\n<h4 style=\"text-align: center;\">Our Mission</h4>\r\n<p style=\"text-align: center;\">Provide the highest quality service to satisfy our client&rsquo;s roofing needs through professional, well-trained and honest employees.</p>\r\n</div>\r\n</div>\r\n<div class=\"gantry-width-33\">\r\n<div class=\"gantry-width-spacer\"><span class=\"rt-image\"><img src=\"images/Skyline-Roofs-Contractors-about-us-2.jpg\" alt=\"Skyline Roofs Contractors \" /></span><br />\r\n<h4 style=\"text-align: center;\">Our Values</h4>\r\n<p style=\"text-align: center;\">Responsibility, Professionalism,<br />Innovation, Enthusiasm<br />and Optimism.</p>\r\n</div>\r\n</div>\r\n<div class=\"gantry-width-33\">\r\n<div class=\"gantry-width-spacer\"><span class=\"rt-image\"><img src=\"images/Skyline-Roofs-Contractors-about-us-3.jpg\" alt=\"Skyline Roofs Contractors \" /></span><br />\r\n<h4 style=\"text-align: center;\">Our Vision</h4>\r\n<p style=\"text-align: center;\">We believe in makinge a difference in our community, the roofing industry, and the way people perceive roofing. We are professionals.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">&nbsp;</div>', '', 1, 12, '2014-03-12 15:46:51', 981, '', '2017-03-29 11:11:42', 981, 0, '0000-00-00 00:00:00', '2014-03-12 15:46:51', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"float_intro\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\",\"float_fulltext\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_