(12, 54, 'FAQ', 'faq', '<h3>Common Queries and Questions</h3>\r\n\r\n<p>Completely synergize resource sucking relationships via premier niche markets. Professionally cultivate one-to-one customer service with robust ideas. Dynamically innovate resource-leveling customer service for state of the art customer service.</p>\r\n<ul>\r\n	<li>Versatile, Flexible Features Powered by the Gantry Framework.</li>\r\n	<li>Gantry is a free framework for both Joomla and WordPress.</li>\r\n	<li>A selection of configurable preset style variations are available.</li>\r\n</ul>\r\n\r\n<p><a href=\"http://www.rockettheme.com/docs/joomla/templates/lexicon\" class=\"readon\">Help &amp; Knowledge</a></p>', '', 0, 12, '2014-03-12 15:48:10', 981, '', '2014-03-20 11:24:03', 627, 0, '0000-00-00 00:00:00', '2014-03-12 15:48:10', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 9, 1, '', '', 1, 101, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(13, 55, 'Offline Page', 'offline-page', '<h3>How to Take Your Joomla! Website Temporarily Offline</h3>\r\n\r\n<p>There may be occasions when you will make your Joomla! website completely unavailable to visitors for a short time. There is a simple switch in the Administrator back-end that enables you to take your website offline very quickly. It can be returned to service at a later time just as easily.</p>\r\n\r\n<p><span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/offline-page/img-01.jpg\" alt=\"image\" /></span></p>\r\n\r\n<p>To make your Joomla! website unavailable to visitors, replacing it with a simple message, do this:</p>\r\n\r\n<ol>\r\n	<li> Log in to the Administrator back-end.</li>\r\n	<li> Click on the <strong>Global Configuration</strong> button in the main Control Panel or click the <strong>Site → Global Configuration</strong> menu item in Joomla 2.5 or <strong>System → Global Configuration</strong> in Joomla 3.2.</li>\r\n	<li> There are so many configuration options that they need to be divided into separate groups or tabs.  The <strong>Site</strong> tab, it should be the default first view displayed, if not click on the tab.</li>\r\n	<li> Find where it says <strong>Site Offline</strong> and change the radio button from <strong>No</strong> to <strong>Yes</strong> in Joomla 2.5 or click the <strong>Yes</strong> button in Joomla 3.2.</li>\r\n	<li><strong>Optional:</strong> Change the <strong>Offline Message</strong> to give your visitors some explanation about why your website is unavailable.</li>\r\n	<li> Click the <strong>Save</strong> toolbar button to implement the new settings:\r\n		<ul>\r\n			<li> The <strong>Save</strong> toolbar button will save your changes and but leave you in Global Configuration.</li>\r\n			<li> The <strong>Save and Close</strong> button will save your changes and return you to the Administrator Control Panel.</li>\r\n		</ul>\r\n	</li>\r\n	<li>You should see a message confirming the settings have been changed.</li>\r\n</ol>\r\n\r\n<p><strong>Lexicon</strong> comes with it\'s own customized <strong>Site Offline</strong> page which is displayed when the site is set to <strong>Offline Mode</strong> within the Joomla! Administration. This page, <strong>/templates/rt_lexicon/offline.php</strong> can be easily customised with your own layout, logo and colours, so it represents a message which relates to your project.</p>', '', 0, 12, '2014-03-12 15:48:19', 981, '', '2014-03-20 12:13:16', 627, 0, '0000-00-00 00:00:00', '2014-03-12 15:48:19', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 33, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
