(22, 89, 'Built-Up Roofing', 'built-up-roofing', '<h2>Built-Up Roofing (BUR)</h2>\r\n<p>Built-up roofing, known commonly in the industry under the acronym BUR, is also referred to as hot tar roofing. This type of roofing has been in use for more than 150 years, so we know that it does an excellent job of protecting buildings. In fact, it is one of the strongest roofs available right now.</p>\r\n<p>BUR consists of bitumen layered with a reinforced fabric to create a membrane that protects and seals in the building securely. There are several different types of bitumen and fabrics used, and the best one varies from building to building. The most common type of bitumen used in BUR is asphalt bitumen or cold-applied adhesive. Asphalt is heated up and then applied by a spreader. Cold-applied adhesives do not have to be heated before they are applied. The types of surfacing that are commonly used include gravel, mineral surfaced or glass fiber sheets, aluminum coatings, hot asphalt, or elastomeric coatings.</p>\r\n<p> </p>\r\n<h2>How does BUR Roofing work?</h2>\r\n<p>The installation of a BUR system involves mechanically fastening the base sheets to the deck, then installing felts with the bitumen material, alternating layers of fabric and bitumen. The surface is a cap sheet of bitumen or a flood coat then an additional layer of gravel or some other type of coating.</p>\r\n<p>One of the most popular options in Arizona is the cool roof application, which is a BUR system that delivers high solar reflectance. With this type of building, business owners experience immediate and long term savings in energy costs. A cool roof cuts down on building heat gain by reducing the temperature the roof will reach during the day. It also extends the life expectancy of the roof membrane, especially under the hot sun. In addition, it cuts down on air pollution.</p>\r\n<p> </p>\r\n<h2>The Advantages of BUR</h2>\r\n<p>There are many reasons BUR roofing may be the best option for your business. BUR roofing is a multi-ply roof, which basically means that there are multiple layers applied over top of each other. As you can imagine, there are many advantages to be enjoyed by opting for a roof with multiple layers, including:</p>\r\n<ul>\r\n<li>It creates a monoliphic watertight barrier that can protect for many years.</li>\r\n<li>Even if the top layer becomes damaged for any reason, the layers underneath it continue to protect.</li>\r\n<li>A BUR system does not expand and contract as much as other types of roofing, which means it is less prone to buckling, splits, and ridges.</li>\r\n<li>No fasteners are needed in the top layers, which is important because fasteners create a place for water to seep in if they are not attached properly.</li>\r\n<li>Multiple layers are much more durable and stable, making it the perfect place for mechanical systems, solar panels, roof gardens, or roof decks.</li>\r\n<li>The incorporation of roofing insulation into the membrane brings a higher R value and better insulation against the hot Florida sun.</li>\r\n<li>BUR roofing has the highest fire rating available in the industry.</li>\r\n<li>BUR can be coated with reflective material to create a cooler roof and protect against UV rays.</li>\r\n<li>Built-up roofing is extremely low maintenance, requiring just an annual inspection to check for clogged drains, gutters, or pitch pockets.</li>\r\n<li>If the top layer becomes damaged, it’s easy and economical to patch the top layer.</li>\r\n</ul>\r\n<p> </p>\r\n<p>At Skyline Roofs Contractors, we have the knowledge and the experience necessary to help business owners determine which type of built-up roofing is best for their building. All materials are covered by the manufacturer’s warranty, and all work is guaranteed by our own warranty.</p>\r\n<p>Let us help you make the best choice for your business and then help you maintain it through the years. With proper maintenance, a built-up roof should last between 15 and 25 years, depending on whether it is a 3-, 4-, or 5-ply roof.</p>', '', 0, 16, '2017-03-09 03:35:48', 981, '', '2017-03-09 03:35:48', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:35:48', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
