(23, 90, 'Single Ply Roofing', 'single-ply-roofing', '<p>Single ply roofing has become more and more popular over the past 30 years. This type of roofing comes in strong, flexible membrane sheets that are made of various materials. Single ply roofing membranes are manufactured to strict quality control requirements. This makes them an excellent option for commercial buildings.</p>\r\n<p>Single ply roofing membranes generally fall under one of two categories: synthetic rubber or thermoplastics. Both have their advantages, but the main difference is the fact that thermoplastics are able to be heated and then reshaped, whereas synthetic rubber heat welded or applied with contact cement. Let Skyline Roofs Contractors help you figure out which one will work best for your building!</p>\r\n<p> </p>\r\n<h2>TPO Roofing</h2>\r\n<p>Skyline Roofs Contractors is an installer of TPO roofing systems from Carlisle SynTec, one of the most trusted names in single ply roofing. TPO is the fastest growing part of the roofing industry for commercial buildings, and Carlisle has been leading the charge. Here’s what you can expect from the TPO packages from Carlisle:</p>\r\n<ul>\r\n<li>The Octaguard XT Weathering Package – This package is a unique combination of materials that keep the membranes from being damaged by ultraviolet rays and heat. In the hot Florida sun, this is essential. The Octaguard XT Weathering Package creates a more reflective and whiter roof that will last longer than roofs manufactured by other companies.</li>\r\n<li>Certified accessories – Overson Roofing also installs certified fabricated accessories made by Carlisle. These accessories serve to finish off your roof to the highest standard possible while helping to save you money and time because they enhance the ease of installation.</li>\r\n<li>Spectro-Weld TPO – The hot Arizona sun also leaves many business owners looking for ways to cut down on consumption of energy and the costs associated with it. The Spectro-Weld TPO option is an excellent choice because it has the highest reflectivity rating from the Cool Roof Rating Council. Spectro-Weld offers even more energy savings than the already high quality Octaguard XT.</li>\r\n</ul>\r\n<h2> </h2>\r\n<h2>EPDM Roofing</h2>\r\n<p>Skyline Roofs Contractors is also an installer of EPDM roofing systems from Carlisle SynTech. This type of single ply membrane has been a top choice for commercial buildings for almost 50 years. Here are some of the options available in EPDM Roofing:</p>\r\n<ul>\r\n<li>Sure-Seal – This type of EPDM roofing is available in both ballasted and fully adhered options, so almost any building will work well with this type of membrane. Installation is quick and easy, so we’ll be finished with your new roof in no time.</li>\r\n<li>Sure-Tough – Mechanically attached or fully adhered versions are available for this type of membrane, which comes with a warranty to protect against accidental puncture. Any building owner who wants water protection for a long time should consider this type of roofing.</li>\r\n<li>Sure-White – This type of roofing is the only white EPDM membrane that is actually Energy Star certified. Any building owner looking to cut down on air conditioning costs should definitely consider this product. These membranes have proven themselves as high quality options over the past two decades, and they will help with your LEED credit requirements.</li>\r\n<li>Factory-applied tape – This ensures that the seams are precise and strong, creating uniform adhesive thickness and width and cutting down on the risk of human error. The seams offer the greatest risk for human error, but that risk is cut down to almost nothing with factory-applied tape.</li>\r\n</ul>\r\n<p> </p>\r\n<p>At Skyline Roofs Contractors, we’ll even help you recycle your old roofing. You don’t even have to do a thing. We’ll handle all aspects of the recycling process, and you’ll earn credits toward LEED certification while improving your carbon footprint. We can’t do enough for the environment these days, and recycling old roofing materials keeps millions of pounds of trash out of the landfills each year.</p>', '', 0, 16, '2017-03-09 03:41:02', 981, '', '2017-03-09 03:41:02', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:41:02', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(24, 91, 'Insulation & Coating', 'insulation-coating', '<div class=\"entry-content1\">\r\n<h1>Roof Insulation</h1>\r\n<p>Your roof plays a pivotal role in keeping your house or office safe from the elements. But did you know that a lot of heat and cold air could escape through your roof? At Skyline Roofs Contractors, we offer top-of-the-line roof insulation to help your roof do its very important job.</p>\r\n<p>An insulated roof can help you maintain a desirable indoor environment when the weather is at its coldest, warmest, or anywhere in between. And what you’ll pay in insulation installation costs, you’ll more than make up for in energy savings throughout the year.</p>\r\n<h2><strong>Thinking About Roof Insulation In South Florida </strong></h2>\r\n<p>Having a well-insulated roof makes your home or place of business more marketable and increases its value. Instead of throwing that money away on monthly utilities, put it to good use by investing in roof insulation. Call Overson Roofing today.</p>\r\n<p>We employ only highly skilled roofers, who excel in their individual roofing specializations. Whether you want flat roofing, slate, tile, asphalt shingle, single ply membrane, green roofs, or even sheet metal work, we can put our experts in charge of the project and guarantee that the best possible results happen for you.</p>\r\n<p>When our work is done, your property will be more attractive and more valuable. And in many cases, your building will be more secure and energy efficient. Before we proceed with any type of work, Skyline Roofs Contractors will perform a complete inspection of your attic, where we will try to locate any weaknesses and sources of air leaks in your attic. We will check the soffit intake ventilation and all areas that requires an air seal, which includes the area behind your knee walls, common sources of attic air leaks the exterior wall plate, the attic hatch, all wiring holes and lights, plumbing pipes, dropped ceilings and furnace flues.</p>\r\n<p>A properly insulated attic cans double the lifespan of your roof, air conditioning and furnace. It also helps prevent the formation of mold, and most importantly, can help you save money on energy bills by stabilizing the temperature of your home.</p>\r\n<h2><strong>Why You Need Roof Insulation </strong></h2>\r\n<p>There are many properties in South Florida that don’t have proper or adequate insulation. This leads to severe consequences. For instance the effectiveness of the measures you take to control the temperature inside your home are significantly reduced. This is an issue that needs immediate attention, as poor insulation will cost the homeowner more money and time in the long run.</p>\r\n<p>Ineffective insulation doesn’t create a proper thermal barrier between the inside and outside of the house. This causes an imbalance of the temperature inside your home and results in the heating and cooling systems within the house to work harder to keep an optimal temperature, thus raising your utility bills. Furthermore overworked heating and cooling systems require more maintenance and repair, which also results in you losing money. This is why when insulating your home; it is always best to choose reliable and experienced professionals at Skyline Roofs Contractors that can get the job done quickly and efficiently.</p>\r\n<p>By increasing your home’s attic insulation, you keep your home cooler in the summer and warmer in the winter! Give us a call for your insulation needs in the South Florida area.</p>\r\n</div>', '', 0, 16, '2017-03-09 03:47:13', 981, '', '2017-03-09 03:47:13', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:47:13', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(25, 92, 'Tile Roof Repair', 'tile-roof-repair', '<h1>Tile Roof Repair &amp; Installation</h1>\r\n<p> </p>\r\n<p>Whether you currently have a <strong>tile roof</strong> and have questions and or problems with it, or you are considering a tile roof for your existing or new home, Skyline Roofs Contractorsg can help!</p>\r\n<p> </p>\r\n<p><strong>Tile roofing</strong> gained popularity and became the roof of choice for many builders and home owners in the late 1980’s and continues to be a preferred roof still in South Florida. Cement and clay tile offer several advantages over asphalt shingles. One of the most obvious is the look of tile. With pitched roofs, a considerable portion of a homes exterior is impacted by the texture and color of the roof. Tile roofs offer an added dimension to the look and feel of a homes elevation.</p>\r\n<p> </p>\r\n<p>If you own a home with tile or are considering tile as an option you may have assumptions about tile, such as: tile is a lifetime roof, or perhaps a 50 year roof? Those assumptions are now being put to the test as many of the tile roofs in the valley reach the 20 and 30 yr age mark. We are now seeing leaks and other issues with tile roofs that require <strong>repairs</strong>, <strong>renovations</strong> or <strong>replacement</strong>.</p>\r\n<h2>Tile Roof Repair in South Florida</h2>\r\n<p> </p>\r\n<p>Having the best information about tile roofs will help you make the best choice in regards to your tile roofing, which can save you money and assure you of a problem free roof for years to come.  We were in business when tile became the roof of choice the 1980’s. We have been in, and have learned a lot about tile roof industry over the years. For many of those years we received occasional calls for simple repairs and that was about it. Now that there are a lot of tile roofs which are hitting the 20 yr mark we are getting more and more calls from homeowners needing more serious help with their tile roofs.</p>\r\n<p> </p>\r\n<p>Most homeowners know very little about tile roofs and so blindly trust a roofing contractor or friend to tell them what they need. Some contractors know and some don’t. Knowing what to do with tile roofing is a rather new industry. Questions like; do you repair sections of the roof where the leak is? Do you replace the felt underlayment? If so, with what kind of material? Do you replace the tile and felt? Do you replace the flashings too? What do you do with broken tile?</p>\r\n<p> </p>\r\n<p>There are a lot of questions and considerations, some of them more effective in function and cost than others.</p>\r\n<p> </p>\r\n<p>If you don’t know the answers, you need someone who does. Call or email us for a free consultation.</p>\r\n<p> </p>\r\n<p>Or read on to learn more about tile roofs.</p>\r\n<p> </p>\r\n<h2>Types of Tile Roofing</h2>\r\n<p> </p>\r\n<h3>Clay, Concrete, Villa, Mission, Flat, Light Weight and More…</h3>\r\n<p> </p>\r\n<p>Through the ages tile roofs have represented the handy-work of skilled craftsman.  From old missions with clay tiles hand-molded over knees, to modern processes creating patterns and colors which allure the eye to our beautiful architectural structures. Tile has made its statement.</p>\r\n<p> </p>\r\n<p><strong>For the way it looks and the way it lasts.</strong></p>\r\n<p> </p>\r\n<p>These are two important reasons that homeowners choose tile for their reroof but there are other reasons beyond beauty and long term durability. Concrete tile is an environmentally-friendly choice. Made from naturally occurring, locally sourced raw materials that are produced in a low-impact, environmentally conscious manufacturing process, tile can make your home more energy efficient its inherent high thermal mass and innovative installation techniques that enhance the breath-ability of a structure.</p>\r\n<p> </p>\r\n<p><strong>Roof System Components</strong></p>\r\n<p> </p>\r\n<p>Cement tile offers a components collection that when used comprehensively results in a superior tile roof installation that offers the highest functionality, performance and energy efficiency available.</p>\r\n<p> </p>\r\n<p><strong>Battens</strong></p>\r\n<p> </p>\r\n<p>Battens are commonly used throughout much of the world to hang and fasten clay and concrete tiles to the roof deck. Skyline Roofs Contractors offers high-performance battens and batten extenders to provide positive anchoring for each tile, while enhancing water flow off the roof for a longer lasting and better performing roof system.</p>\r\n<p> </p>\r\n<p><strong>Eave Closures</strong></p>\r\n<p> </p>\r\n<p>Proper eave treatment creates a finished look for the roof. Eave Risers elevate the tiles at the eave to the proper height while also blocking the openings at the eve to prevent infestation of birds and vermin.</p>\r\n<p> </p>\r\n<p><strong>Anti-Ponding Taper Strip</strong></p>\r\n<p> </p>\r\n<p>Required with fascias and they help prevent water from collecting behind raised fascia and causing rot. They are lightweight, easy to handle and install.</p>\r\n<p> </p>\r\n<p><strong>Underlayment’s</strong></p>\r\n<p> </p>\r\n<p>While tile is ultimately the first line of defense against the elements on a roof installation, underlayment’s play a critical role by providing a secondary level of waterproofing protection directly on top of the wood roof deck. As a crucial barrier that contributes to the performance and longevity of the entire roof system, it is important to choose the right underlayment for your roof and your particular climate.</p>\r\n<p> </p>\r\n<p><strong>Flashing</strong></p>\r\n<p> </p>\r\n<p>To ensure the long-term integrity of a roof system, it is critical to prevent water, snow and debris from entering the system. Critical areas, such as intersections of different sloped roof decks at hips &amp; valleys as well as junctions or penetrations such as walls, chimneys, skylights, vents and plumbing pipes, must be properly flashed to keep the system water tight. While many different materials are available, Overson Roofing has several types of high-integrity flashing options to choose from for optimal performance and protection.</p>\r\n<p> </p>\r\n<p><strong>J Tile Pan</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>\r\n<div>Double ribs elevate tile &amp; battens above water flow area</div>\r\n</li>\r\n<li>\r\n<div>Ribs create water channels to direct water flow off roof and away from waterproofing underlayment</div>\r\n</li>\r\n<li>\r\n<div>Superior water flow prevents one of the most common causes of roof failure – debris accumulation that blocks water flow and directs it into the roof system!</div>\r\n</li>\r\n<li>\r\n<div>Flat edge allows sealing and fastening outside the water flow area</div>\r\n</li>\r\n<li>\r\n<div>26 gauge galvanized steel for corrosion resistant, long-term durability</div>\r\n</li>\r\n<li>\r\n<div>Suitable for all tile profiles</div>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Tile Ridge Vent</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>\r\n<div>Universal ridge vent and weather block</div>\r\n</li>\r\n<li>\r\n<div>Cost effective, code-compliant ventilation</div>\r\n</li>\r\n<li>\r\n<div>8 square inches airflow per linear foot at optimal location</div>\r\n</li>\r\n<li>\r\n<div>Reduce number of field vents</div>\r\n</li>\r\n<li>\r\n<div>Rollable installation reduces labor and installation costs</div>\r\n</li>\r\n<li>\r\n<div>Butyl adhesive strips provide a weather-tight seal</div>\r\n</li>\r\n<li>\r\n<div>Two sizes to fit all tile profiles</div>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>Ventilation</strong></p>\r\n<p> </p>\r\n<p>An estimated 75% of homes have deficient attic ventilation, where soaring temperatures can drive up energy costs and diminish the lifespan of roofing underlayment’s. Alleviate many of these concerns with ventilation. These products ensure proper ventilation and help reduce energy costs, with aesthetics that are superior to other vents.</p>\r\n<p> </p>\r\n<ul>\r\n<li>Superior performance in an aesthetic design</li>\r\n<li>Low-profile design blends with surrounding tiles</li>\r\n<li>Paint-ready to match any tile color</li>\r\n<li>High impact polystyrene body</li>\r\n<li>Tile clip for maximum wind uplift resistance</li>\r\n<li>Rain guard prevents entry of wind-driven rain</li>\r\n<li>Mesh sub-flashing included prevents insect and rodent infestation</li>\r\n<li>Locks securely into surrounding field tiles</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>O’Hagan Vents</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li> Complete line of flame and ember resistant vents</li>\r\n<li>Safety vents reduce the risk of fire due to direct flame and flying embers</li>\r\n<li>Reduce risk of damage due to wind driven rain or snow</li>\r\n<li>20 year limited warranty</li>\r\n<li>Comparable NFVA to conventional vent designs – independently tested and certified</li>\r\n<li>Easy to paint</li>\r\n<li>26 gauge galvanized steel, G90 for long life</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>', '', 0, 15, '2017-03-09 03:50:11', 981, '', '2017-03-09 03:50:11', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:50:11', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 7, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(26, 93, 'Shingle Roofing', 'shingle-roofing', '<h1>Shingle Roofing Installation &amp; Repair</h1>\r\n<p> </p>\r\n<p>Whether you currently have a <strong>shingle roof</strong> and have questions and or problems with it or you have another type of pitched roof (such as wood shakes) and are considering a shingle roof, <a title=\"Home\" href=\"http://www.oversonroofing.com/\">Overson Roofing</a> can help.</p>\r\n<p> </p>\r\n<p>We have been installing shingle roofs for over 3 decades now. Our list of <a href=\"http://www.oversonroofing.com/contact/\">satisfied </a><a title=\"Reviews\" href=\"http://www.oversonroofing.com/about-us/reviews/\">customers</a> is long.</p>\r\n<p> </p>\r\n<h2>Repair or replace Shingle Roofs?</h2>\r\n<p> </p>\r\n<p>Knowing when to repair a shingle roof or replace it can help save you the costs of water damage, inconvenience, and $$$$’s.</p>\r\n<p> </p>\r\n<p>The easiest way to know whether you roof needs a repair or replacement is to call us for a FREE consultation, or simply fill out the form to the right.</p>\r\n<p> </p>\r\n<p>If you want to learn more about Shingle roofs, read on.</p>\r\n<p> </p>\r\n<h2>Shingle Roofing Systems</h2>\r\n<p> </p>\r\n<p>A high-performance roof takes more than just shingles. The performance of any roof depends on an entire system of accessory products working and performing together, including ventilation, hip and ridge shingles, underlayment, and attic insulation.</p>\r\n<p>Roofing manufacturers will not warrant their products unless they are applied as part of a complete roof system-</p>\r\n<p> </p>\r\n<p><strong>DECK PROTECTION</strong>: Felt paper is applied directly to your roof decking, for optimal moisture protection.</p>\r\n<p> </p>\r\n<p><strong>QUALITY SHINGLES</strong>: We only install the top lines from the top brand name shingle companies.</p>\r\n<p> </p>\r\n<p><strong>PROPER VENTILATION</strong>: It is important to have proper ventilation to remove excessive heat and moisture from your attic, that can raise your energy bill and will compromise the longevity of your shingles.</p>\r\n<p> </p>\r\n<p><strong>RIDGE CAPPING</strong>: This is the final seal on your roof that protects it at the ridge and hips; also to give it that final high definition appeal.</p>\r\n<p> </p>\r\n<p>Working in unison, these elements can provide maximum performance and efficiency. Shingles by themselves may look nice, but without considering the whole package, you could be looking at major roof or attic problems down the road.</p>\r\n<p> </p>\r\n<p><strong>CHOICES?</strong></p>\r\n<p> </p>\r\n<p>When it comes to selecting shingles you have a variety of choices in quality, color, style, brand and warranty. We are certified roofing specialists with the major shingle brands, Owens Corning &amp; GAF/ELK. We are also qualified to install Certainteed, Tamko, and Malarkey brand shingles.</p>\r\n<p> </p>\r\n<p><strong>ASPHALT COMPOSITION (FIBERGLASS) SHINGLES</strong></p>\r\n<p> </p>\r\n<p>Composition shingles have a fiberglass reinforcing mat at the center. This mat is coated with asphalt and mineral fillers. The fillers adhere to the fiberglass and the asphalt surrounds the structure, making it waterproof. Its top surface is embedded with a layer of ceramic granules. Asphalt Composition shingles offer multi-level protection and are durable, reliable and easy to maintain throughout the life of the roof. They all come with a Class “A” fire rating and have warranties available in 20 yr., 25 yr., 30 yr., 40 yr., 50 yr., and lifetime. They can be separated into three categories: 3-Tab, Laminates/Dimensional and Designer shingles.</p>\r\n<p><strong>3-Tab Shingles 20, 25 Year Manufacturers Warranty</strong></p>\r\n<p>The least expensive option is known as “3-Tab” shingles. This type of roofing has been refined over the years. It appears as a one layer product with a distinct pattern of tabs. This pattern is caused by vertical slots notched into the visible part of each shingle, splitting the lower half of the shingle into three tabs.</p>\r\n<p><strong>Laminates / Dimensional Shingles 30, 40, 50 Year Manufacturers Warranty</strong></p>\r\n<p>Laminates/Dimensional shingles also known as architectural shingles, are created by bonding or laminating two asphalt shingles together (doubling the material thickness), giving them a distinct three-dimensional appearance similar to that of wood shakes. They are a more recent variant and superior to the basic 3-Tab. Laminates have become the common choice in composition roofing, are considered more attractive, are heavier in weight, and have longer life spans.</p>\r\n<p><strong>Designer Shingles 50 Year, Lifetime Manufactures Warranty</strong></p>\r\n<p>Most shingle manufacturers produce a line of designer shingles that offer the homeowner a variety of more sophisticated and unique design options. Typically, designer shingles are heavy weight, multi-layer laminates that provide deeper shadow lines, richer texture, and are physically larger than standard Laminates. Some are also made to simulate more expensive roofing materials like slate.</p>', '', 0, 15, '2017-03-09 03:51:23', 981, '', '2017-03-09 03:51:23', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:51:23', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 6, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(27, 94, 'Attic Ventilation', 'attic-ventilation', '<p><strong>Attic ventilation</strong> is an important part of your home’s design and construction. An estimated 75% of homes have deficient attic ventilation, where soaring temperatures can drive up energy costs and diminish the lifespan of roofing underlayment’s. Alleviate many of these concerns with ventilation. These products ensure proper ventilation and help reduce energy costs, with aesthetics that are superior to other vents.</p>\r\n<ul>\r\n<li>In the summer, attic ventilation can <strong>help prevent heat buildup</strong>, which will help make your living areas cooler and more comfortable, help reduce air conditioning costs and help prevent roof shingle deterioration.  The major shingle manufacturers require attic ventilation to validate the shingle warranty. </li>\r\n<li>In the winter, attic ventilation can <strong>help prevent moisture buildup</strong>, which will help prevent wood rot, mold, mildew, and poor indoor air quality.</li>\r\n</ul>\r\n<p>Your attic needs equal <strong>intake</strong> and <strong>exhaust </strong>ventilation. Research has shown that the best way to ventilate an attic is with a balanced system of intake vents low at the roof’s edge or in the soffit/eaves, along with exhaust vents high on the roof at or near the ridge. This allows cool, dry intake air at the roof’s edge to flush out any warm, moist air through the exhaust vents. Be sure your attic has enough intake vents. They are crucial to the attic ventilation system and often overlooked.</p>\r\n<p>Indications that your attic might have a ventilation problem include:</p>\r\n<ul>\r\n<li>Curling or cracking shingles</li>\r\n<li>Wet or compressed insulation</li>\r\n<li>Rusty spots that dripped onto your insulation</li>\r\n<li>Blackened plywood</li>\r\n<li>Mold or mildew inside your attic</li>\r\n</ul>\r\n<h2>TILE VENTS</h2>\r\n<p> </p>\r\n<h3>Tile Ridge Vent</h3>\r\n<p> </p>\r\n<ul>\r\n<li>Tile ridge vents are rather new and innovative. They are cosmetically hidden by the ridge cap tiles, yet still allow for hot air to escape at the high point of the attic.</li>\r\n<li>Universal ridge vent and weather block</li>\r\n<li>Cost effective, code-compliant ventilation</li>\r\n<li>8 square inches airflow per linear foot at optimal location</li>\r\n<li>Reduce number of field vents</li>\r\n<li>Rollable installation reduces labor and installation costs</li>\r\n<li>Butyl adhesive strips provide a weather-tight seal</li>\r\n<li>Two sizes to fit all tile profiles</li>\r\n</ul>\r\n<h3>O’Hagan Vents</h3>\r\n<p> </p>\r\n<ul>\r\n<li>Complete line of flame and ember resistant vents</li>\r\n<li>Safety vents reduce the risk of fire due to direct flame and flying embers</li>\r\n<li>Reduce risk of damage due to wind driven rain</li>\r\n<li>20 year limited warranty</li>\r\n<li>Comparable NFVA to conventional vent designs – independently tested and certified</li>\r\n<li>Easy to paint</li>\r\n<li>26 gauge galvanized steel, G90 for long life</li>\r\n</ul>\r\n<h3>SHINGLE VENTS</h3>', '', 0, 15, '2017-03-09 03:52:05', 981, '', '2017-03-09 03:52:05', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:52:05', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 5, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(28, 95, 'Roof Inspection', 'roof-inspection', '<p>Whether you need two tiles replaced, or a complete roof inspection due to a leak in your roof, Overson Roofing can help. We have a dependable <a title=\"About Us\" href=\"http://www.oversonroofing.com/about-us/\">fleet of roofing technicians</a> in Phoenix, Arizona, to satisfy all your roofing needs. What this means to you is FAST SERVICE! No matter what your roofing needs are, we will get the job done.</p>\r\n<h2><strong>Do I Need A Roof Review? </strong></h2>\r\n<p>If your <a title=\"Roofing Repair\" href=\"http://www.oversonroofing.com/roof-repair/\">roof needs repairs</a>, it’s best to do them while any damage is minimal. Our team of experts will help diagnose any leaks by uncovering the <a href=\"http://www.awebtoknow.com/home-inspection-checklist/\">warning signs of potential roof problems</a>.  A roofing expert from Overson Roofing can assess what work is required.  If you have spotted any of the warning signs listed below, ask us for an inspection. It’s worth protecting your home from further damage!</p>\r\n<ul>\r\n<li>roof is 15 years or older</li>\r\n<li>blistered or stained interior walls or ceilings</li>\r\n<li>torn flashings</li>\r\n<li>missing or torn shingles</li>\r\n<li>peeling paint or water-stained brick where the walls meet the roof</li>\r\n<li>sagging eaves troughs</li>\r\n</ul>\r\n<h2><strong>Roof Leak Detection and Inspection </strong></h2>\r\n<p>When hidden leaks go undetected, the problem threatens property values, your utility costs increase, and repairs become more costly. Making sure your roof is secure, energy-efficient, and within code is one of the best investments you can make in your home or commercial property. When you need your roof inspected in metro Phoenix, Arizona, —whether for new construction compliance, insurance requirements, or just to be on the safe side—you can depend on Overson Roofing to give you an honest evaluation after a thorough inspection of interior and exterior factors.</p>\r\n<p><strong>Why wait for the rain to show you that your roof leaks?</strong></p>\r\n<p>If you suspect your roof may have problems, Call us for a FREE ROOF INSPECTION and avoid the costly repairs a leak can cause in wood rot, drywall damage, mold issues, structural integrity. We will look at your roof and give you a general evaluation of the condition of your roof. If there are problem areas, such as listed above, we can make repairs or if needed consult you on a new roof.</p>\r\n<p><strong>IF YOU HAVE A LEAK</strong></p>\r\n<p>If the rain has found its way into your home, Call us OR fill in the form to the right for a FREE ROOF INSPECTION and one of our professional and experienced estimators will trace the leak back to its source and give you a proposal to fix your leak.</p>\r\n<p>There are many warning signs that Overson Roofing will help you detect. Here are just some of them:</p>\r\n<p><strong>Bare Spots:</strong> The protective granular surface of shingles wears off as the asphalt, into which the granules are embedded, begins to harden over time. Fine fissures often accompany bare spots on the shingles’ surface and by the accumulation of granules in the gutters.</p>\r\n<p><strong>Curling:</strong> The upward curling of shingle tabs makes them highly susceptible to wind and ice damage. This is a problem on older roofs where moisture build-up in the attic affects the underside of the shingle.</p>\r\n<p><strong>Broken Shingles:</strong> Damage can be caused by extreme wind conditions and snow removal. Since shingles are supposed to shed water, broken, torn or missing tabs become obvious entry points for water, especially on low slope roofs where run-off is slower and at the peaks of the roof where shingles are the most vulnerable to high winds.</p>\r\n<p>Overson Roofing leads the competition in <strong>residential and commercial roofing </strong>with a record of success based on years of professional performance delivering dependability, longevity, and building strength.</p>\r\n<p>Our team is highly skilled and experienced and will take extra care to ensure your satisfaction upon completion of your roofing project. We do it all! From small repairs to complete re-roofs, plus … we specialize in construction defect repairs, rapid response team for those roofing emergencies and we also offer free estimates.</p>', '', 0, 15, '2017-03-09 03:52:59', 981, '', '2017-03-09 03:52:59', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:52:59', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 4, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(29, 96, 'FAQ\'s', 'faq-s', '<h2>USE THIS CHECKLIST BEFORE YOU SIGN ANY CONTRACT:</h2>\r\n<p><span style=\"text-decoration: underline;\">Company Reputation</span>—does the company have a good reputation for the work to be done? Have you checked their references? Is the contractor licensed and bonded, and fully insured?</p>\r\n<p><span style=\"text-decoration: underline;\">Roof Inspection</span>—has a complete rooftop inspection been made? Beware of a Ground level estimate</p>\r\n<p><span style=\"text-decoration: underline;\">Bid Explained</span>—Do you know exactly what each bid includes and what it doesn’t include?</p>\r\n<p><span style=\"text-decoration: underline;\">That Low Bid</span>—look it over carefully. Does it include the same work?</p>\r\n<p><span style=\"text-decoration: underline;\">Under Writers Laboratories</span>—always request class A, U.L. Approved Roof Systems</p>\r\n<p><span style=\"text-decoration: underline;\">Alternative Solutions</span>—have all problems involved been explained by the estimator? Quick-Fix, Bargain estimates should be studied carefully.</p>\r\n<p><span style=\"text-decoration: underline;\">The Warranty</span>—Is it just a piece of paper or does it really protect your investment? Have you seen a copy of the warranty?</p>\r\n<p><span style=\"text-decoration: underline;\">After the work is completed</span>—the job should not only be supervised during all phases, but inspected completely when its finished <span style=\"text-decoration: underline;\">before</span> you pay the final bill.</p>\r\n<p><span style=\"text-decoration: underline;\">Clean-up</span>—Does the bid include thorough clean-up including removing all traces of the work involved?</p>\r\n<h2>Helpful Hints for Home or Business Owner</h2>\r\n<p>During the roofing project, your home or business will become a temporary construction site. We would like to prepare you for some minor inconveniences which may be encountered while the work is in progress. We’ll do our best to keep them to a minimum and ask you for your help and cooperation during this process.</p>\r\n<ul>\r\n<li>We will need access to your driveway from start to finish. Please remove all cars from the garage that you may need. The driveway must also be cleared of all cars, boats etc.</li>\r\n<li>Be prepared for loud noises and vibrations. The constant hammering, walking around and the moving of material can cause a lot of noise and vibrations</li>\r\n<li>Please remove all loose. Breakable items from your walls and shelves i.e. pictures, plates figurines and keepsakes, which may be dislodged.</li>\r\n<li>Please remove all items where roofing debris might fall, such as patio and pool furniture barbecue grills and potted plants etc.</li>\r\n<li>For safety reasons be sure to keep children and pets away from the hazard zone, which consists of a 10 to 20 foot perimeter around your house, you may want to keep them indoors for their safety of the workers</li>\r\n<li>As the job progresses you may notice dust or debris in your yard as well as in your skylights or ducts. Please be aware that a thorough clean-up will follow the completion of the work.</li>\r\n<li>All work performed by Overson Roofing will be left in waterproof condition when rain is in the forecast</li>\r\n<li>Our crews contact supervisors with cell phones; should you have any concerns or questions regarding the proceedings, please call the office and ask to speak with the supervisor</li>\r\n<li>To ensure satisfaction the supervisor will inspect your roof within a few days of completion. At that time, you will also have the opportunity to inspect the roof. Should you find any problems you may write to Overson at the above address.</li>\r\n<li>We will use our best efforts to re-install your satellite back to its original location; however your satellite company my need to realign it.</li>\r\n<li>Finally, with your permission, Overson roofing would like to place a sign on your property to display the quality of our workmanship to other potential customers in the area.</li>\r\n</ul>\r\n<p>Thank you for your business,</p>\r\n<p><em> </em></p>', '', 0, 15, '2017-03-09 03:53:56', 981, '', '2017-03-09 03:53:56', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:53:56', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 3, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(30, 97, 'Insurance FAQ\'s', 'insurance-faq-s', '<h2>What if my roof is damaged and I do not realize it until months later?</h2>\r\n<p>While wind and hail damage can often be detected by missing shingles or leaking roofs immediately after the storm, sometimes it can take many weeks or months after the storm to realize the damage.  In these cases, you should get an expert’s opinion on the extent of the damages.</p>\r\n<h2>Do I have to get three estimates before choosing a contractor to fix my roof?</h2>\r\n<p>No you don’t.  Most all policies are replacement cost policies, which means your insurance company will pay you the cost to replace your roof even if you are only get one estimate. They might encourage you to get three estimates, but it is not necessary.   Be sure that you call licensed and bonded professionals that can produce local references that are at least one year old.</p>\r\n<h2>Can I fix it myself?</h2>\r\n<p>While some minor repairs can be done by the DIY homeowner, if you want to get the full Replacement Cost Value (RCV), including the depreciation, then you will have to hire a licensed contractor. The Actual Cash Value (ACV) is all you will get from the insurance company, if you do it yourself.</p>\r\n<h2>Will my insurance company pay for the damages?</h2>\r\n<p>Most homeowners insurance will pay for the hail storm damage. At Overson Roofing we provide free estimates and always keep our customers informed throughout the repair or replace process.  We are experienced roofers, serving the entire Phoenix metro region for over 30 years.</p>\r\n<p>Hail and high winds can cause severe damage to the exterior of your home including the roof, A/C unit and paint.  An inspection by a trained expert can verify the extent of the damages and help you navigate the often cumbersome task of dealing with your insurance carrier to get the repairs paid for.</p>', '', 0, 15, '2017-03-09 03:54:33', 981, '', '2017-03-09 03:54:33', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:54:33', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
