(31, 98, 'Storm Damage FAQ', 'storm-damage-faq', '<h1>Storm Damage FAQs</h1>\r\n<ul>\r\n<li>What is hail damage, and how do I find out if my property has been affected by the storm?</li>\r\n<li>How do I file an insurance claim?</li>\r\n<li>My claim was denied or only partial repairs were given, what do I do now?</li>\r\n<li>Is this a scam? Are you cheating my insurance company?</li>\r\n<li>Will my premium increase if I file a claim?</li>\r\n<li>Will filing a claim affect my homes value?</li>\r\n<li>How do I choose a contractor?</li>\r\n</ul>\r\n<h2>What is hail damage, and how do I find out if my property has been affected by the storm.</h2>\r\n<p>When driven by high winds, marble size hail and larger can cause substantial damage to roofs, A/C units, paint and window screens.  It only has to hail for a few seconds to cause damage.</p>\r\n<p>Damage to a roof is not always visible from the ground.  Composition asphalt roofs suffer granular loss.  Granular loss causes premature cracking of the protective asphalt underlayment, significantly decreasing the life of your roof. Roof damage should be accessed as soon as possible after the storm. Damage from hail can comprise the value of your roof.  Ignoring this damage could possibly lead to severe problems in the future, including leaks during heavy rains and greatly accelerated roof deterioration during exceptionally hot months.  In order to make an accurate assessment the inspector must be willing to get on your roof and examine the shingles from close range.  Although identifying hail damage is partly subjective, the Haag Engineering company has established a criteria and procedure for assessing hail damage the is use industry wide among insurance companies.  All contractors should be using the same criteria as well.</p>\r\n<p>Wind driven hail often dents air conditioning coils, windows, wooden pediments, gutters, fascia and stucco.  Typically your insurance carrier is going to want to see collateral damage on other areas of the home to make an initial assumption that the roof is indeed damaged.  Frequently, this collateral damage goes unnoticed, until it is pointed out and identified by a trained expert.  Have the exterior of your home inspected by one of our professionals to be safe.  There is no charge for this inspection.</p>\r\n<h2>How do I file a claim with my insurance company?</h2>\r\n<p>Call your insurance agent and submit a hail claim for the October 5<sup>th</sup>, 2010 storm.  You will be assigned an adjuster and a claim number.  Your adjuster will call you and set up a time to meet with you and the contractor of your choice.  Your contractor and adjuster will jointly inspect your property for insured damage. The inspection will inspect your roof for signs of hail damage. If he/she can find a sufficient amount of bruising or breaks, your carrier will pay for a new roof, less your deductible.</p>\r\n<h2>My claim was denied or my insurance carrier only paid for some repairs, what can I do now?</h2>\r\n<p>In most cases you are entitled to two inspections by 2 different adjusters representing your insurance company.  Denied or partial claims often stem from insurance companies changing the scope of what they are covering under their hail policy.  Initial inspections, especially those performed without a contractor present to advocate on the homeowners behalf, are often held to more stringent guidelines.  If you notice neighbors getting substantial amounts of work done to their homes, have your home inspected by a knowledgeable contractor.  If the contractor feels there is more damage than noted in your first adjustment, call your carrier and request a re-adjustment.  This is not an unusual request so do not be afraid to exercise this right.  Have the second adjuster meet with your contractor of choice and jointly re-inspect the your home.</p>\r\n<h2>Is this a scam?  Are you cheating your insurance company?</h2>\r\n<p>No. This is not a scam by the contractors.  Neither a contractor nor a homeowner can convince an insurance company to pay out thousands of dollars for hail repairs unless the damage is identifiable and significant enough to satisfy predetermines thresholds established by your carrier.   All a contractor can do is provide an expert eye during the adjustment process to assure that any and all damage sustained by your property is properly identified and compensated for in the adjustment phase.</p>\r\n<h2>Will my premiums increase if I file a claim?</h2>\r\n<p>No.  Individual insurance rates are not adversely affected by filing a claim for hail related damage.  Hail claims are deemed an “Act of God” under the terms and conditions of your policy, your individual policy with not increase.</p>\r\n<h2>How do I choose a contractor?</h2>\r\n<p>Make sure the contractor you choose is a licensed contractor in the State of Arizona.</p>\r\n<p>Avoid contractors asking for down payments before construction begins.</p>\r\n<p>Make sure your contractor is insured and can provide written notification of their insurance policy.</p>\r\n<p>Make sure your contractor is local to the Valley.  There are many contractors who have coverage on our area posing as local companies, but in fact not.  Beware of contractors who do not have local license plates, who are unfamiliar with your area, or who are not listed in the yellow pages.</p>\r\n<p>Make sure your contractor is using brand name roofing products.  Stick with the names you know in roofing ElK, GAF, Tamko, and Certainteed are some of the well known and respected manufacturers in the roofing industry.</p>', '', 0, 15, '2017-03-09 03:55:13', 981, '', '2017-03-09 03:55:13', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:55:13', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(32, 99, 'Roof Repair', 'roof-repair', '<div class=\"entry-content1\">\r\n<h1>Roof Repair in Phoenix AZ</h1>\r\n<p>If you’re looking for a roof repair company in Phoenix Valley, Overson Roofing can help both homeowners and commercial property owners. Whether you own your own home or run your own business, we understand that you’ve made a big investment by purchasing your property. We can help you maintain that investment by delivering high quality service at a great value. You can rest assured that we will work hard to ensure that you have a great experience working with us.</p>\r\n<p>We can handle a variety of repairs, including wind and water damage, in addition to clearing debris. It all starts with a complete and thorough inspection. Our contractors will survey your roof to find compromises, damage, and entry points for leaks. We will draw up a written estimate and discuss the best solutions with you in detail. Once we start work, we will make every effort to provide prompt project completion. We maintain safe work areas, and we always clean up after we’ve completed the job.</p>\r\n<p>In Arizona, Overson Roofing is committed to completing your project right the first time. We always strive to provide high quality work for a reasonable rate. Give us a call today to receive your free written estimate.</p>\r\n<p>In addition to reroofing services; Overson Roofing repairs all types of roofs (tile, asphalt composition, shake, steel/metal, flat/low sloped). Whether you have an ongoing leak, or are simply interested in knowing the condition of your roof, Overson Roofing provides homeowners free estimates that itemize any necessary repairs, the cost of the repairs, and any warranties that apply to your particular roof system. Our estimators will take digital photos of the specific problem areas of the roof to help them evaluate the condition of the roof and provide you with an accurate repair quote. These photos become part of the estimate and are for the homeowner to view upon request.</p>\r\n<h2><a title=\"Tile Roof Repair\" href=\"http://www.oversonroofing.com/residential-roofing/tile-roof-repair/\"><strong>TILE ROOF REPAIRS</strong></a></h2>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Cracked Tiles\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_crack2.jpg\" alt=\"Cracked Tiles\" border=\"0\" /><strong>Cracked Tiles</strong><br /> Homes with cement tile roofs often will crack and can be damaged after they have been walked on. Cracked tiles will allow water to penetrate past the tile and onto the felt paper. Prolonged sun &amp; water on the felt paper can cause the felt to deteriorate and leak into the home.</p>\r\n<p> </p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Curved Cement Tile Roofs\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_position.jpg\" alt=\"Curved Cement Tile Roofs\" border=\"0\" /><strong>Curved Cement Tile Roofs</strong><br /> Curved cement tiles can shift or blow off after a strong wind. Curved tiles along roof edges and ridges may also shift, due to the craftsmanship needed to install them properly during the roof installation.</p>\r\n<p> </p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Roof Valley\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_debris.jpg\" alt=\"Roof Valley\" border=\"0\" /><strong>Roof Valley</strong><br /> Debris Blocking Water Flow-The roof valley is designed to allow water to flow underneath the roof valley tiles and down a specially designed metal trough. When this passage is blocked with leaves and dirt, the water is then forced to flow sideways across your roof, while still under the roof tiles. This can lead to seepage/deterioration of the roof underlayment and possible leaks into your home.</p>\r\n<p><strong>ALL ROOF TYPES</strong></p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Improper Flashing\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_flashing.jpg\" alt=\"Improper Flashing\" border=\"0\" /><strong>Improper Flashing</strong><br /> The sheet metal that is on your roof plays a very important role in protecting your roof from leaking. Flashing (sheet metal) that outlines nearly all objects that project from your roof, is installed to direct water away from areas where it might otherwise be able to get under the roofing material and leak into your home.</p>\r\n<p> </p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Debris and Water Damage\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_debris.jpg\" alt=\"Debris and Water Damage\" border=\"0\" /><strong>Debris and Water Damage</strong><br /> Long periods of excessive debris and standing water can lead any type of roof to premature problems/damage. Water may not drain properly if debris is not cleaned. In some cases, trapped water can rise above flashing and deteriorate the underlying wood sheathing.</p>\r\n<p> </p>\r\n<p><strong>Wind Damage</strong> Damage from the wind can affect any type of roof (wood shake/shingles, asphalt composition shingles). Asphalt composition shingles are most affected because they are light weight and once one shingle is lifted; entire sections can also blow off.</p>\r\n<p> </p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Inadequate/Improper Workmanship\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_poor.jpg\" alt=\"Inadequate/Improper Workmanship\" border=\"0\" /><strong>Inadequate/Improper Workmanship</strong><br /> Problems can occur on any type of roof, if the previous roofing contractor did not pay attention to detail or use the proper skills and technique needed for the roof repair. Problems may not occur immediately after the roof is repaired; it may take months for them to arise.</p>\r\n<p> </p>\r\n<p><strong>WOOD CEDAR SHAKE/SHINGLES</strong></p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Splitting/Breaking\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_rotten-shake.jpg\" alt=\"Splitting/Breaking\" border=\"0\" /><strong>Splitting/Breaking</strong><br /> The felt paper installed under the shakes is what keeps your home watertight. The shakes are designed for aesthetics, but more importantly, they are designed to keep the sun from deteriorating the felt paper. Over time, shakes and <a href=\"http://www.oversonroofing.com/residential/shingle-roofing/\">shingles</a> can dry out, deteriorate, curl, or split when exposed to the sun. When this occurs, the felt paper under the shakes is compromised and can result in leakage into the home. Signs of aging may appear sooner on sections of the roof depending on which side is exposed to the sun and wind the most.</p>\r\n<p> </p>\r\n<p><strong>AVOIDING COSTLY MISTAKES/ALL ROOF TYPES</strong></p>\r\n<p><img class=\"alignleft\" style=\"border: 0px;\" title=\"Careless/Unprofessional Previous Repairs\" src=\"http://www.oversonroofing.com/wp-content/uploads/2013/11/repair_careless.jpg\" alt=\"Careless/Unprofessional Previous Repairs\" border=\"0\" /><strong>Careless/Unprofessional Previous Repairs</strong><br /> When a homeowner or contractor is trying to cut costs or save time, they may feel pressure to pour roofing sealer all around a suspected leak area, without first identifying exactly where the leak is actually coming from.</p>\r\n<p>Aside from the unprofessional appearance, careless repairs made in this manner can require a professional roofing company like Overson Roofing to make a more costly, and complex subsequent repair than would otherwise be necessary.</p>\r\n<p>One of the first steps in a proper repair project is dismantling the area to be repaired. This task becomes more difficult when everything in the project area is covered in roofing tar.</p>\r\n<p><strong>Why wait for the rain to show you that your roof leaks?</strong></p>\r\n<p>If you suspect your roof may have problems, Call us for a FREE ROOF INSPECTION and avoid the costly repairs a leak can cause in wood rot, drywall damage, mold issues, structural integrity. We will look at your roof and give you a general evaluation of the condition of your roof. If there are problem areas, such as listed above, we can make repairs or if needed consult you on a new roof.</p>\r\n<p><strong>IF YOU HAVE A LEAK</strong></p>\r\n<p>If the rain has found its way into your home, Call us OR fill in the form to the right for a FREE ROOF INSPECTION and one of our professional and experienced estimators will trace the leak back to its source and give you a proposal to fix your leak.</p>\r\n</div>', '', 0, 15, '2017-03-09 03:56:39', 981, '', '2017-03-09 03:56:39', 0, 0, '0000-00-00 00:00:00', '2017-03-09 03:56:39', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(33, 102, 'Residential Roofing', 'residential-roofing', '<p><span style=\"font-size: 12pt;\">At <strong>Skyline Roofs Contractors</strong> we have the best residential&nbsp;roofing South Florida has to offer. Our master roofers will come out to your residence to give you a free in-person consultation, inspection and estimate. We believe that a well-informed costumer will make the best decision when purchasing a new roof. During your consultation a certified roofing contractor will come out and evaluate your roof and explain everything our company has to offer you and to ensure you receive the best quality roof and customer service you can buy.&nbsp; We are licensed and insured.</span></p>\r\n<p>&nbsp;</p>\r\n<h3>We Provide Free Estimates</h3>\r\n<p><span style=\"font-size: 12pt;\">The cost of a new roof can vary depending on the material selected, the contractor doing the work and the size of the home and material needed.&nbsp; Each material type such as asphalt shingles, tile, and foam have different grades of quality and styles with different price ranges.&nbsp; Our roofing specialists will work with you to help you select a material for your particular project.</span></p>\r\n<p><span style=\"font-size: 12pt;\">To schedule a free consultation and cost estimate with one of out roofing specialists<br />please call us at <strong>(305) 303-8560</strong>.</span></p>\r\n<p>&nbsp;</p>\r\n<h3>We offer:</h3>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">New Roof Installation</span></li>\r\n<li><span style=\"font-size: 12pt;\">Roof Inspections / Evaluation</span></li>\r\n<li><span style=\"font-size: 12pt;\">Custom Roof Design</span></li>\r\n<li><span style=\"font-size: 12pt;\">Preventative Maintenances</span></li>\r\n<li><span style=\"font-size: 12pt;\">Roof Repairs (minor to major roof repairs)</span></li>\r\n<li><span style=\"font-size: 12pt;\">New Construction</span></li>\r\n<li><span style=\"font-size: 12pt;\">Existing Construction</span></li>\r\n</ul>', '', 1, 2, '20