(34, 103, 'Commercial Roofing', 'commercial-roofing', '<h3>All Types of Commercial &amp; Industrial Roofing</h3>\r\n<p><span style=\"font-size: 12pt;\">For commercial roofing jobs large or small, you can&rsquo;t beat the reliable service and top-quality materials you&rsquo;ll receive from the roofing specialists at <span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span>. For over 20 years we&rsquo;ve specialized in all types of commercial roofing work, from new construction, to patching leaks and more.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Commercial roofing services from Skyline Roofs Contractors can be tailored to suit all types of business and industrial structures, including:</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Warehouses</span></li>\r\n<li><span style=\"font-size: 12pt;\">Apartments / Condos</span></li>\r\n<li><span style=\"font-size: 12pt;\">Banks</span></li>\r\n<li><span style=\"font-size: 12pt;\">Churches</span></li>\r\n<li><span style=\"font-size: 12pt;\">Schools</span></li>\r\n<li><span style=\"font-size: 12pt;\">Gymnasiums</span></li>\r\n<li><span style=\"font-size: 12pt;\">Stores &amp; Markets</span></li>\r\n<li><span style=\"font-size: 12pt;\">Hospitals</span></li>\r\n<li><span style=\"font-size: 12pt;\">Office Buildings</span></li>\r\n<li><span style=\"font-size: 12pt;\">Industrial Buildings</span></li>\r\n<li><span style=\"font-size: 12pt;\">Any Type Of Commercial Property!</span></li>\r\n</ul>\r\n<p><br /><span style=\"font-size: 12pt;\"> If you&rsquo;re considering a new roof, re-roof or roof repair project for your commercial property, contact us online today, or give us a call (305) 303-8560 today for a FREE ESTIMATE from the commercial roofing experts at <span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span>.</span></p>', '', 1, 2, '2017-03-29 04:50:28', 981, '', '2017-03-29 07:31:12', 981, 0, '0000-00-00 00:00:00', '2017-03-29 04:50:28', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float