(10029, 0, 'System - RokUpdater', 'plugin', 'rokupdater', 'system', 0, 1, 1, 0, '{\"name\":\"System - RokUpdater\",\"type\":\"plugin\",\"creationDate\":\"November 5, 2013\",\"author\":\"RocketTheme, LLC\",\"copyright\":\"(C) 2005 - 2013 RocketTheme, LLC. All rights reserved.\",\"authorEmail\":\"support@rockettheme.com\",\"authorUrl\":\"http:\\/\\/www.rockettheme.com\",\"version\":\"1.0.8\",\"description\":\"\\n        \\n        <div class=\\\"updater-description\\\">\\n        <img src=\\\"..\\/plugins\\/system\\/rokupdater\\/assets\\/images\\/RokUpdater_154.png\\\" class=\\\"img-padding\\\" \\/><h1>RokUpdater<\\/h1>\\n        <p>RokUpdater allows you to update RocketTheme extensions you have access to with your RocketTheme subscription.<\\/p>\\n        <\\/div>\\n        \\n    \",\"group\":\"\"}', '{\"show_auth_on_updates\":\"1\",\"hide_unavailable\":\"0\",\"fallback_to_http_for_auth\":\"0\",\"debugloglevel\":\"63\"}', '{\"access_token\":null,\"expires\":null,\"scope\":null,\"refresh_token\":null,\"token_type\":null,\"notice\":null,\"username\":null,\"subscriptions\":[]}', '', 0, '0000-00-00 00:00:00', 10, 0),
