(90, 0, 'Menu Presets', '', '<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset1\">\r\n				<img src=\"images/rocketlauncher/styles/preset1.jpg\" alt=\"Preset 1\" /><br />\r\n				<span>Preset 1</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset2\">\r\n				<img src=\"images/rocketlauncher/styles/preset2.jpg\" alt=\"Preset 2\" /><br />\r\n				<span>Preset 2</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div><br />\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset3\">\r\n				<img src=\"images/rocketlauncher/styles/preset3.jpg\" alt=\"Preset 3\" /><br />\r\n				<span>Preset 3</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset4\">\r\n				<img src=\"images/rocketlauncher/styles/preset4.jpg\" alt=\"Preset 4\" /><br />\r\n				<span>Preset 4</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div><br />\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset5\">\r\n				<img src=\"images/rocketlauncher/styles/preset5.jpg\" alt=\"Preset 5\" /><br />\r\n				<span>Preset 5</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n	<div class=\"gantry-width-50\">\r\n		<div class=\"gantry-width-spacer rt-center\">\r\n			<a href=\"?presets=preset6\">\r\n				<img src=\"images/rocketlauncher/styles/preset6.jpg\" alt=\"Preset 6\" /><br />\r\n				<span>Preset 6</span>\r\n			</a>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>', 1, 'menu-presets', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(91, 0, 'Responsive Layout', '', '<p class=\"promo1\">Responsive Layout</p>\r\n\r\n<p class=\"promo2\">A responsive design automatically adapts itself to a particular viewing environment such as desktop, tablet or mobile, without the need for separate layouts for varying platforms</p>\r\n\r\n<p><img src=\"images/rocketlauncher/features/features-overview/responsive-layout.png\" alt=\"image\" /></p>', 1, 'showcase-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"rt-center\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(92, 0, 'Complete Features List', '', '<h4>Lexicon Features</h4>\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Responsive Layout</li>\r\n				<li>1200 Fixed Layout Option</li>\r\n				<li>960 Fixed Layout Option</li>\r\n				<li>Custom Logo Option</li>\r\n				<li>Chart.js</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>6 Preset Styles</li>\r\n				<li>8 Styled Module Suffixes</li>\r\n				<li>Dropdown-Menu &amp; Split-Menu</li>\r\n				<li>Mobile Menu</li>\r\n				<li>Custom Typography</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Offline Page</li>\r\n				<li>Coming Soon Page</li>\r\n				<li>404 Error Page</li>\r\n				<li>Email Subscription Form</li>\r\n				<li>Social Buttons Option</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>\r\n\r\n<h4>Gantry Core Features</h4>\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Configurable Grid Sizes</li>\r\n				<li>Font Selector</li>\r\n				<li>Custom Branding</li>\r\n				<li>Load Transitions</li>\r\n				<li>Page Suffix Support</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Date Display</li>\r\n				<li>Login Panel</li>\r\n				<li>Custom Copyright</li>\r\n				<li>MainBody &amp; Component Toggle</li>\r\n				<li>IE7 Redirect Page</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Font Sizer</li>\r\n				<li>Popup Panel</li>\r\n				<li>To-Top Scroller</li>\r\n				<li>Basic RTL Support</li>\r\n				<li>Menu Assignment</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>\r\n\r\n<h4>Technical Requirements and Support</h4>\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Gantry Framework</li>\r\n				<li>PHP 5.3.10+</li>\r\n				<li>MySQL 5.0.4+</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Apache 2.x+ or Microsoft IIS 7+</li>\r\n				<li>Firefox, Chrome, Safari, Opera, IE8+</li>\r\n				<li>HTML5, CSS3, LESS</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<ul class=\"nomarginbottom\">\r\n				<li>Joomla 3.2 Support</li>\r\n				<li>Joomla 2.5 &amp; 3.2 RocketLauncher</li>\r\n				<li>Adobe Fireworks PNG Sources</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>', 7, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(93, 0, 'MainBody / Sidebar Layouts', '', '<p>The layouts for the mainbody area is slightly different from the other module layouts. The primary difference is that the mainbody is generally displayed along with up to 3 sidebars. This provides the ability for <strong>Lexicon</strong> template to effectively support a four-column layout.</p>\r\n\r\n<p>Configure at <strong>Admin &rarr; Extensions &rarr; Template Manager &rarr; rt_lexicon</strong>, then go to <strong>Layouts</strong> tab and set the varying Mainbody/Sidebar layout possibilities.</p>\r\n\r\n<div class=\"gantry-width-33\">\r\n	<div class=\"gantry-width-spacer\">\r\n		<span class=\"rt-image\"><img src=\"images/rocketlauncher/features/module-positions/position-config-mb1.jpg\" alt=\"image\" /></span>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"gantry-width-33\">\r\n	<div class=\"gantry-width-spacer\">\r\n		<span class=\"rt-image\"><img src=\"images/rocketlauncher/features/module-positions/position-config-mb2.jpg\" alt=\"image\" /></span>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"gantry-width-33\">\r\n	<div class=\"gantry-width-spacer\">\r\n		<span class=\"rt-image\"><img src=\"images/rocketlauncher/features/module-positions/position-config-mb3.jpg\" alt=\"image\" /></span>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div><br />\r\n\r\n<p class=\"success\">Note: If no modules are assigned to the Sidebar positions, the Mainbody will become full width.</p>\r\n\r\n<div class=\"rt-mbsb-table hidden-phone\">\r\n	<div class=\"gantry-width-50 largemarginbottom\">\r\n	<div class=\"largemarginright\">\r\n		<div class=\"gantry-width-30\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-center\">\r\n		      <thead>\r\n		        <tr>\r\n		          <th colspan=\"1\"><h5 class=\"nomarginall\">Sidebar</h5></th>\r\n		        </tr>\r\n		      </thead>\r\n		      <tbody>\r\n		        <tr>\r\n		          <td class=\"rt-sb-table-col\">A</td>\r\n		        </tr>\r\n		      </tbody>\r\n		    </table>\r\n		  </div>\r\n		</div>\r\n		<div class=\"gantry-width-30\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-center\">\r\n		      <tbody>\r\n		        <tr>\r\n		          <td class=\"rt-mb-table-col\"><h5>Mainbody</h5></td>\r\n		        </tr>\r\n		      </tbody>\r\n		    </table>\r\n		  </div>\r\n		</div>\r\n		<div class=\"gantry-width-40\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-center\">\r\n		      <thead>\r\n		        <tr>\r\n		          <th colspan=\"2\"><h5 class=\"nomarginall\">Sidebar</h5></th>\r\n		        </tr>\r\n		      </thead>\r\n		      <tbody>\r\n		        <tr>\r\n		          <td class=\"rt-sb-table-col\">B</td>\r\n		          <td class=\"rt-sb-table-col\">C</td>\r\n		        </tr>\r\n		      </tbody>\r\n		    </table>\r\n		  </div>\r\n		</div>\r\n		<div class=\"clear\"></div>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-50 largemarginbottom\">\r\n	<div class=\"largemarginleft\">\r\n		<div class=\"gantry-width-40\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-center\">\r\n		      <thead>\r\n		        <tr>\r\n		          <th colspan=\"2\"><h5 class=\"nomarginall\">Sidebar</h5></th>\r\n		        </tr>\r\n		      </thead>\r\n		      <tbody>\r\n		        <tr>\r\n		          <td class=\"rt-sb-table-col\">A</td>\r\n		          <td class=\"rt-sb-table-col\">B</td>\r\n		        </tr>\r\n		      </tbody>\r\n		    </table>\r\n		  </div>\r\n		</div>\r\n		<div class=\"gantry-width-30\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-center\">\r\n		      <tbody>\r\n		        <tr>\r\n		          <td class=\"rt-mb-table-col\"><h5>Mainbody</h5></td>\r\n		        </tr>\r\n		      </tbody>\r\n		    </table>\r\n		  </div>\r\n		</div>\r\n		<div class=\"gantry-width-30\">\r\n		  <div class=\"smallmarginall\">\r\n		    <table class=\"table table-bordered gantry-cent