(94, 0, 'Basic: Using Gantry Layouts', '', '<div class=\"gantry-width-25 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n    <a title=\"Video Tutorial :: Using Gantry Layouts\" href=\"http://www.gantry-framework.org/videos/joomla/g4-module-widths.mp4\">\r\n        <img src=\"images/rocketlauncher/features/module-positions/using-layouts.jpg\" alt=\"Using Layouts\" />\r\n    </a>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"gantry-width-75 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n    <p>To find out about <strong>Gantry Layouts</strong> and <strong>Module Widths</strong>, check out this screencast which covers basic concepts of configuring layout with a combination of module setting and the Gantry layout control.</p>\r\n\r\n    <a class=\"readon smallmargintop\" href=\"http://www.gantry-framework.org/documentation/joomla/configure/layouts.md\" target=\"_blank\"><span>View : Using Layouts</span></a>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>', 2, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(95, 0, 'Advanced: Adding Positions', '', '<div class=\"gantry-width-25 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n    <a title=\"Video Tutorial :: Module Positions\" href=\"http://www.gantry-framework.org/videos/joomla/g4-module-positions.mp4\">\r\n      <img src=\"images/rocketlauncher/features/module-positions/adding-module-positions.jpg\" alt=\"Adding Module Positions\" />\r\n    </a>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"gantry-width-75 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n    <p>Check out this quick screencast on <strong>Module Positions</strong> to get an overview of how module positions work within Gantry Framework. Click below button to learn how to <strong>add a new row of module positions</strong>.</p>\r\n\r\n    <a class=\"readon smallmargintop\" href=\"http://www.gantry-framework.org/documentation/joomla/customize/\" target=\"_blank\"><span>Learn : Adding Positions</span></a>\r\n  </div>    \r\n</div>\r\n\r\n<div class=\"clear\"></div>', 1, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
