(97, 74, 'Testimonials', '', '<p class=\"promo1\" style=\"text-align: center;\">Testimonials</p>\r\n<hr />', 1, 'content-bottom-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(98, 75, 'Residential & Commercial', 'fp', '<h1 style=\"text-align: center;\">Residential &amp; Commercial Roofing Services</h1>\r\n<div>\r\n<div>\r\n<div>\r\n<p><span style=\"font-size: 12pt;\"><img src=\"images/Skyline-Roofs-Contractors-roofer4.png\" alt=\"Skyline Roofs Contractors\" style=\"float: right;\" /></span><span style=\"font-size: 12pt;\"><strong>Skyline Roofs Contractors</strong> is a Miami based roofing company that has been providing South Florida homeowners and businesses with the professional Residential &amp; Commercial roofing solutions since 2008. We not only strive to make each homeowner a customer, but to also make each customer a friend. Referrals are a majority of our business and we want your experience with <span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span> to be the finest you will ever encounter with a roofing company.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Our reputation is a reflection of our commitment to providing our customers with the highest level of workmanship and customer service available in South Florida, and surrounding areas. We are committed to providing you the following:</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">High Quality Residential &amp; Commercial Roofing Solutions</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Fully Insured with written guarantees and references</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Free Inspection and Free Estimates, No Obligation</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Excellent Workmanship by Factory Certified Installers</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Sweep Work Area With Magnetic Nail Bar</span></li>\r\n<li><span style=\"font-size: 12pt; color: #962a1f;\">Approved by all Major Insurance Companies</span></li>\r\n</ul>\r\n<p>{loadposition fp-content}</p>\r\n<hr />\r\n<p><span style=\"font-size: 12pt;\">As a South Florida roofing company, <span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span></span> works extensively through Miami-Dade, Fort Lauderdale and surrounding areas. When sufficient damage exists, we will deal with insurance companies and insurance adjusters to insure that you get the fairest settlement amount that you are entitled to as a homeowner. We screen and handpick all of our roofing crews in order to ensure the highest quality craftsmanship and service. </span></p>\r\n<div><span style=\"font-size: 12pt;\">Our goal is not only to fix or replace your roof, but also to deliver a long lasting and dependable roofing solution in a manner that is efficient, cost-effective, and convenient. The professionals at <span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">Skyline Roofs Contractors</span></span> will inspect your roof for free and walk you through claims and construction process.</span></div>\r\n</div>\r\n</div>\r\n</div>', 2, 'content-top-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
