(104, 0, 'Using a Suffix', '', '<p>Enter any available suffixes at <strong>Extensions &rarr; Module Manager &rarr; <em>Module</em> &rarr; Module Class Suffix</strong>.</p>\r\n<p class=\"notice nomarginbottom\">You can compound multiple suffixes together such as: <strong><em>box3 title3</em></strong>.</p>', 1, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box3 title3\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(105, 0, 'box1 title2', '', '<p>An <a href=\"#\">example</a> module using the <strong>box1 title2</strong> module suffix.</p>\r\n<p>Lorem ipsum dolor sit amet, consecetur adipiscing elit donec sit amet nibh.</p>\r\n<a href=\"#\" class=\"readon\">Read More</a>', 2, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box1 title2\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(106, 0, 'box4 title4', '', '<p>An <a href=\"#\">example</a> module using the <strong>box4 title4</strong> module suffix.</p>\r\n<p>Lorem ipsum dolor sit amet, consecetur adipiscing elit donec sit amet nibh.</p>\r\n<a href=\"#\" class=\"readon\">Read More</a>', 3, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box4 title4\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(107, 0, 'No Suffix', '', '<p>An <a href=\"#\">example</a> module using <strong>no module suffix</strong>.</p>\r\n<p>Lorem ipsum dolor sit amet, consecetur adipiscing elit donec sit amet nibh.</p>\r\n<a href=\"#\" class=\"readon\">Read More</a>', 4, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(108, 0, 'Additional Module Class Suffixes', '', '<ul>\r\n  <li><strong>rt-center:</strong> centres the content of the module.</li>\r\n  <li><strong>rt-uppercase, rt-lowercase:</strong> change the case of the module title.</li>  \r\n  <li><strong>nomargintop, nomarginright, nomarginbottom, nomarginleft, nomarginall:</strong> removes the various margins around the module.</li>    \r\n  <li><strong>nopaddingtop, nopaddingright, nopaddingbottom, nopaddingleft, nopaddingall:</strong> removes the various paddings around the module.</li>    \r\n    <li><strong>(small/med/large)margintop, (small/med/large)marginright, (small/med/large)marginbottom, (small/med/large)marginleft:</strong> increase the paddings around the module.</li>\r\n  <li><strong>(subsmall/submed/sublarge)margintop, (subsmall/submed/sublarge)marginright, (subsmall/submed/sublarge)marginbottom, (subsmall/submed/sublarge)marginleft, (subsmall/submed/sublarge)marginall:</strong> decrease the paddings around the module.</li>  \r\n</ul>', 3, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(109, 0, 'Why Use RokCandy', '', '<p><strong>RokCandy</strong> is the ideal solution for those with <strong>limited coding skills</strong> or those who implement our templates for their clients.</p>\r\n\r\n<p>It is <strong>free</strong> from the WYSIWYG editors horrific filtering habits and can be easily pre-configured for your <strong>personal needs</strong> or the needs of your client.</p>\r\n\r\n<a href=\"http://www.rockettheme.com/joomla/extensions/rokcandy\" class=\"readon\" target=\"_blank\">Download : RokCandy</a>', 4, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(110, 0, 'More About RokCandy', '', '<div class=\"gantry-width-25\">\r\n  <div class=\"gantry-width-spacer nomargintop\">\r\n    <a href=\"http://www.rockettheme.com/joomla/extensions/rokcandy\">\r\n      <img src=\"images/rocketlauncher/features/typography/rokcandy.png\" alt=\"RokCandy\" />\r\n    </a>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"gantry-width-75\">\r\n  <div class=\"gantry-width-spacer nomargintop\">\r\n    <p><strong>RokCandy</strong> provides <strong>BBCode style macro functionality</strong> for Joomla. RokCandy changes the preset syntax, such as <strong>[example]</strong> to the relevant HTML code during the rendering of the <strong>Joomla article or custom module</strong>.</p>\r\n  </div>    \r\n</div>', 2, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(111, 0, 'Set Menu Type', '', '<div class=\"gantry-width-50 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n      <p class=\"visible-large\">RokNavMenu provides a feature rich platform for extending the menu, allowing for overrides and plugins for the menu itself, in addition to versatile theming capabilities and so much more.</p>\r\n      \r\n    <p>To find all the parameters for Dropdown Menu &amp; SplitMenu on Acacia template, such as position, please navigate to:</p>\r\n    \r\n    <ul class=\"dots\">\r\n      <li><strong>Extensions &rarr; Template Manager &rarr; rt_Lexicon</strong></li>\r\n      <li>Then go to <strong>Menu</strong> tab, and set the Menu parameters</li>\r\n    </ul>\r\n    \r\n    <p class=\"largemargintop attention\">Descriptions of each template parameter can be seen when you mouseover the label of each option.</p>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"gantry-width-50 gantry-width-block\">\r\n  <div class=\"gantry-width-spacer\">\r\n    <div class=\"rt-image\">\r\n      <img src=\"images/rocketlauncher/features/menu-options/menu-setting.jpg\" alt=\"Set Menu\" />\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>', 2, 'showcase-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(112, 0, 'SubText Line', '', '<p>This option allows you to insert additional text to the Menu Item Title, including the SubMenu Title. There is separate styling for this, making it useful for adding snippets to menu items.</p>', 6, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(113, 0, 'Menu Icon', '', '<p>RokNavMenu provides the option to display a small icon image, powered by FontAwesome, for the menu item. The menu icon can be displayed both for the parent items and the child items.</p>', 3, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(114, 0, 'Multi-Columns', '', '<p>Who needs a single dropdown column when you can have as many as you want? Using the built-in configurable parameters, you can make up to four incredible multi column dropdowns.</p>', 1, 'footer-c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(115, 0, 'Various Pages[span class=\"rt-title-tag\"]Flexible and adaptable sample pages[/span]', '', '<p class=\"promo2\">See a range of example page layouts possible with Lexicon template, through its responsive layout and the Gantry Framework grid system</p>', 3, 'showcase-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"rt-center rt-title-large\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(116, 0, 'Lexicon Demo', '', '<p class=\"hidden-phone\">These examples are intended to show how Lexicon can be constructed on your site, above and beyond the frontpage demonstration. These include Joomla content and component pages, with varying modular content, mainbody widths and page lengths.</p>\r\n\r\n<p class=\"nomarginbottom\">All demo content is for sample purpose only, intended to show a live site. Use the <a href=\"http://www.rockettheme.com/joomla/templates/lexicon\">Lexicon RocketLauncher</a> to install an equivalent of the demo onto your site.</p>', 5, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"rt-phone-center\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(117, 80, 'Logo Bottom', '', '<div style=\"text-align: center;\"><img src=\"images/Skyline-Roofs-Contractors-Logo-300.png\" alt=\"Skyline Roof Contractors\" width=\"250\" height=\"151\" /></div>\r\n<div>&nbsp;</div>\r\n<div style=\"text-align: center;\">Skyline Roofs Contractors<br />Off: (305) 554-6050<br /> Cel: (305) 303-8560<br /> skylineroofs@gmail.com</div>', 1, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"rt-phone-center nomarginbottom nopaddingbottom\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(118, 83, 'About Us-Header', '', '<p class=\"promo1\"><span style=\"color: #962a1f;\">About Us</span></p>', 1, 'content-top-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"nomargintop nopaddingtop nomarginbottom nopaddingbottom box3\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(119, 105, 'About Us: Introduction - Mission Statement', '', '<div class=\"gantry-row\">\r\n<div class=\"gantry-width-50\">\r\n<div class=\"gantry-width-spacer\"><span class=\"rt-image\"><img src=\"images/Skyline-Roofs-Contractors-about-us1.jpg\" alt=\"Skyline Roofs Contractors\" style=\"margin-bottom: 10px;\" /></span></div>\r\n</div>\r\n<div class=\"gantry-width-50\">\r\n<div class=\"gantry-width-spacer\">\r\n<p><span style=\"font-size: 12pt;\"><strong>Skyline Roofs Contractors</strong> is a family owned and operated business with an amazing track record for providing outstanding quality and service. Customer satisfaction and a properly installed roofing system is our goal on every job, we guarantee you will be satisfied. </span></p>\r\n<p><span style=\"font-size: 12pt;\">Skyline Roofs Contractors employs an excellent team of experienced technicians who have the knowledge to properly handle any type of roofing needs. </span></p>\r\n<p><span style=\"font-size: 12pt;\">With over 20 years experience, Skyline Roofs Contractors is the natural choice for all of your residential and commercial roofing needs.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #ffffff; font-size: 14pt;\"><a href=\"/contact-us\" class=\"readon\" style=\"color: #ffffff;\">Contact Us Now</a></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"clear\">&nbsp;</div>\r\n<hr />', 2, 'content-top-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box3 nomargintop nopaddingtop\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(120, 0, 'About Us: Our Mission - Our Values - Our Solution', '', '<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/about-us/img-02.jpg\" alt=\"image\" /></span>\r\n			<h4>Our Mission</h4>\r\n			<p>Objectively innovate empowered manufactured products whereas parallel platforms. Holisticly predominate extensible testing procedures for reliable supply chains.</p>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/about-us/img-03.jpg\" alt=\"image\" /></span>\r\n			<h4>Our Values</h4>\r\n			<p>Proactively envisioned multimedia based expertise and cross-media growth strategies. Seamlessly visualize quality intellectual capital without superior collaboration.</p>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/about-us/img-04.jpg\" alt=\"image\" /></span>\r\n			<h4>Our Solution</h4>\r\n			<p>Engage worldwide methodologies with web-enabled technology. Interactively coordinate proactive e-commerce via process-centric outside the box thinking.</p>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div>', 2, 'mainbottom-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box3 rt-title-center\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(121, 0, 'We Always Try to Create a Difference', '', '<p>Utilized with Versatile and Flexible Features Powered by the Gantry Framework.</p>\r\n\r\n<p><a href=\"http://www.rockettheme.com/joomla/templates/lexicon\" class=\"readon\">Download Lexicon</a></p>', 1, 'extension-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box2 rt-center\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(122, 0, 'The Team[span class=\"rt-title-tag\"]Meet the People Behind Lexicon[/span]', '', '&nbsp;', 5, 'showcase-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"rt-center rt-title-large rt-nomodulecontent\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(123, 0, 'Management Team', '', '<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/the-team/img-01.jpg\" alt=\"image\" /></span>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-66\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<h3 class=\"nomarginbottom\">Robert Smith</h3>\r\n			<h6 class=\"nomargintop\">CEO of Lexicon</h6>\r\n			<p>Globally incubate standards compliant channels before scalable benefits. Quickly disseminate superior deliverables whereas web-enabled applications. <span class=\"hidden-tablet\">Quickly drive clicks-and-mortar catalysts for change before vertical architectures.</span></p>\r\n			<p class=\"success hidden-tablet\">Image attribution: <a href=\"http://www.flickr.com/photos/astragony/8260117875/sizes/l/\">AMaze by Daniele Zedda.</a></p>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div><br />\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<span class=\"rt-image\"><img src=\"images/rocketlauncher/pages/the-team/img-03.jpg\" alt=\"image\" /></span>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"gantry-width-66\">\r\n		<div class=\"gantry-width-spacer\">\r\n			<h3 class=\"nomarginbottom\">Tayla Parker</h3>\r\n			<h6 class=\"nomargintop\">Accountant</h6>\r\n			<p>Globally incubate standards compliant channels before scalable benefits. Quickly disseminate superior deliverables whereas web-enabled applications. <span class=\"hidden-tablet\">Quickly drive clicks-and-mortar catalysts for change before vertical architectures.</span></p>\r\n			<p class=\"success hidden-tablet\">Image attribution: <a href=\"http://www.flickr.com/photos/johnonolan/5729506059/sizes/l/\">Stare by JohnONolan.</a></p>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"clear\"></div><br />\r\n\r\n<div class=\"gantry-row\">\r\n	<div class=\"gantry-width-33\"