(3, 'fp-request-a-quote', '{error}\n<!-- Do not remove this ID, it is used to identify the page so that the pagination script can work correctly -->\n<fieldset class=\"formContainer\" id=\"rsform_{global:formid}_page_0\">\n	<div class=\"form-row\">\n		<div class=\"col-12\">\n			<div class=\"form-group rsform-block rsform-block-text{text:errorClass}\">\n					{text:body}\n			</div>\n			<div class=\"form-group rsform-block rsform-block-name{Name:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{Name:description}\" for=\"Name\">{Name:caption}</label>\n				<div class=\"formControls\">\n					{Name:body}\n					<div><span class=\"formValidation\">{Name:validation}</span></div>\n				</div>\n			</div>\n			<div class=\"form-group rsform-block rsform-block-email{Email:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{Email:description}\" for=\"Email\">{Email:caption}</label>\n				<div class=\"formControls\">\n					{Email:body}\n					<div><span class=\"formValidation\">{Email:validation}</span></div>\n				</div>\n			</div>\n			<div class=\"form-group rsform-block rsform-block-subject{Subject:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{Subject:description}\" for=\"Subject\">{Subject:caption}</label>\n				<div class=\"formControls\">\n					{Subject:body}\n					<div><span class=\"formValidation\">{Subject:validation}</span></div>\n				</div>\n			</div>\n			<div class=\"form-group rsform-block rsform-block-message{Message:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{Message:description}\" for=\"Message\">{Message:caption}</label>\n				<div class=\"formControls\">\n					{Message:body}\n					<div><span class=\"formValidation\">{Message:validation}</span></div>\n				</div>\n			</div>\n			<div class=\"form-group rsform-block rsform-block-captcha{captcha:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{captcha:description}\" for=\"captcha\">{captcha:caption}</label>\n				<div class=\"formControls\">\n					{captcha:body}\n					<div><span class=\"formValidation\">{captcha:validation}</span></div>\n				</div>\n			</div>\n			<div class=\"form-group rsform-block rsform-block-spacer{Spacer:errorClass}\">\n					{Spacer:body}\n			</div>\n			<div class=\"form-group rsform-block rsform-block-send{Send:errorClass}\">\n				<label class=\"control-label formControlLabel\" data-toggle=\"tooltip\" title=\"{Send:description}\" for=\"Send\">{Send:caption}</label>\n				<div class=\"formControls\">\n					{Send:body}\n					<div><span class=\"formValidation\">{Send:validation}</span></div>\n				</div>\n			</div>\n		</div>\n	</div>\n</fieldset>', '[[{\"columns\":[[\"28\",\"23\",\"24\",\"25\",\"26\",\"31\",\"30\",\"27\"]],\"sizes\":[\"12\"]}],[]]', 'bootstrap4', 1, 1, 1, 0, 0, '', '', 'FP Request a Quote', 0, 1, 'en-GB', '', 1, 1, 0, 0, '<p>Thank you for your inquiry! We will contact you as soon as possible.</p>', 1, '', '', '', '', '', '', '', '', 1, 0, '', '<p><span style=\"font-size: 12pt;\">You have a new website inquiry. Here are the details.</span></p>\r\n<p><span style=\"font-size: 12pt;\">{Name:caption}: <span style=\"color: #0000ff;\">{Name:value}</span></span></p>\r\n<p><span style=\"font-size: 12pt;\">{Email:caption}: <span style=\"color: #0000ff;\">{Email:value}</span></span></p>\r\n<p><span style=\"font-size: 12pt;\">{Subject:caption}: <span style=\"color: #0000ff;\">{Subject:value}</span></span></p>\r\n<p><span style=\"font-size: 12pt;\">{Message:caption}: <span style=\"color: #0000ff;\">{Message:value}</span></span></p>', 'skylineroofs@gmail.com', '', 'lazaro@suarezmultimedia.com', 'info@skylineroofscontractors.com', '', 'Skyline Roofs Contractors', 'New Inquiry from \'SkylineRoofsContractors.com\'!', 1, '', '', '', '', '', '', '', '', 1, '', '', '', '', '', '', '', '', 0, '', '', '', '<p class=